printWorkOrderAndSubWorkOrders.dataForTemplate:
let childWorkOrders = $getGrid('opportunityLines').filter(
  (f) => f.topLevelWorkOrder == rowData.rowKey
);

console.log('childWorkOrders: ', childWorkOrders);

// Fetch workOrderOperations and workOrderMaterials for each childWorkOrder
childWorkOrders.forEach((childWorkOrder) => {
  childWorkOrder.$topLevelWorkOrder = null
  childWorkOrder.$parentWorkOrder = null
  // Fetch matching workOrderOperations
  let workOrderOperations = $getGrid('workOrderOperations').filter(
    (operation) => operation.workOrder === childWorkOrder.rowKey
  );

  // Fetch matching workOrderMaterials
  let workOrderMaterials = $getGrid('workOrderMaterials').filter(
    (material) => material.workOrder === childWorkOrder.rowKey
  );

  // Remove potential circular references
  workOrderOperations.forEach((op) => {
    if (op.$parentWorkOrder) delete op.$parentWorkOrder;
    if (op.$topLevelWorkOrder) delete op.$topLevelWorkOrder;
    op.$workOrder = null
  });

  workOrderMaterials.forEach((mat) => {
    if (mat.$parentWorkOrder) delete mat.$parentWorkOrder;
    if (mat.$topLevelWorkOrder) delete mat.$topLevelWorkOrder;
    mat.$workOrder = null
  });

  childWorkOrder.workOrderOperations = workOrderOperations;
  childWorkOrder.workOrderMaterials = workOrderMaterials;

});

// Assign the enriched childWorkOrders to rowData
rowData.childWorkOrders = childWorkOrders;

// Safely stringify
console.log('Updated rowData: ', rowData);

rowData;

